                    "author_association": "CONTRIBUTOR",
                    "body": "> > Have you created the account of XC1111111111111111@xuper already?\r\n> \r\n> yes, also charged an amount\r\n> \r\n> > ./xchain-cli account balance XC1111111111111111@xuper\r\n> \r\n> return 100100\r\n\r\nThe error information of \"rpc error: code = Unknown desc = get account XC1111111111111111@xuper error: Key not found\" means that you haven't created the contract account of XC1111111111111111@xuper , and the efficient way to check if you have created the account of XC1111111111111111@xuper is to query the acl information of XC1111111111111111@xuper, such as the command of `./xchain-cli acl query --account XC1111111111111111@xuper` instead of using the command of `./xchain-cli account balance XC1111111111111111@xuper`.\r\nIt is just like taking a command of `./xchain-cli transfer --to bob --amount 100` doesn't mean you have created the address of bob though you can get the balance of bob using the command of `./xchain-cli account balance bob`. Right?",
