            "body": "**Brief of the issue**\r\nTransfer without fee will make a mistake when configuring  reserved contracts.But that's not the case.\r\n**Your environment**\r\nxchain-cli version v3.2-7f817ef\r\n\r\n**Repo steps**\r\nstep1 \r\n./bin/xchain-cli transfer --to=XC1562641423020263@xuper --amount=5000000\r\nThe response is :\r\nFailed to post tx: logid:\"1562661833014935008_2_1847\" error:RWSET_INVALID_ERROR\r\nstep2\r\n./bin/xchain-cli transfer --to=XC1562641423020263@xuper --amount=5000000 --fee\r\nSuccessful transfer in this way which need fee.\r\n\r\n**Expected behaviours**\r\nSuccessful transfers in this way do not require fee.\r\n\r\n**What actually happened**\r\nTransfer without fee will fail.\r\n\r\n**Additional information**\r\nIf possible, include a minimal, complete, and verifiable example to help us identify the issue. This also helps check that the issue is not with your own code.\r\n",
