            "body": "**Brief of the issue**\r\n./xchain-cli wasm invoke -a '{\"action\":\"transfer\",\"from\":\"bob\",\"to\":\"alice\",\"token_id\":\"1\"}' --method invoke -H localhost:37102 erc721test\r\nError message\r\nPreExe contract response : rpc error: code = Unknown desc = contract error status:500 message:Missing key: from, logid:1562163683405800715_1_8081\r\n\r\n**Your environment**\r\nubuntu16.04    64bit    8G\r\ng++ 5.4.0\r\ngo 1.12.6\r\n\r\n**Repo steps**\r\nstep1 \r\n./xchain-cli wasm deploy --account XC1111111111111111@xuper --cname erc721test -H localhost:37102 -a '{\"supply\":\"1,2,3,4,5,6\",\"from\":\"bob\"}' data/erc721 --runtime go --fee 6205188\r\n\r\nstep2\r\n./xchain-cli wasm invoke -a '{\"from\":\"bob\",\"supply\":\"1,2\"}' --method initialize -H localhost:37102 erc721test --fee 101800\r\n\r\nstep3  Error occurred\r\n./xchain-cli wasm invoke -a '{\"action\":\"transfer\",\"from\":\"bob\",\"to\":\"alice\",\"token_id\":\"1\"}' --method invoke -H localhost:37102 erc721test\r\n\r\nPreExe contract response : rpc error: code = Unknown desc = contract error status:500 message:Missing key: from, logid:1562163683405800715_1_8081\r\n\r\n**Expected behaviours**\r\nPerform different transactions through invoke, and query transactions\r\n\r\n**What actually happened**\r\nDeploy and initialize are correct. Invoke error?\r\n\r\n**Additional information**\r\n\r\n",
