            "body": "**Brief of the issue**\r\nOpen the configuration switch of coreconnection and launch a routing attack.\r\nLong after the attack was over, one node gets block error when sync block.\r\n\r\n**Your environment**\r\nXuperUnion  V3.2\r\n\r\n**Repo steps**\r\nsetp1\r\nOpen configuration switch of coreconnection.\r\nstep2\r\nLaunch a routing attack.\r\nstep3\r\nLong after the attack was over, a node gets block error when sync block.\r\n![image](https://user-images.githubusercontent.com/51076943/61207340-7204ef80-a727-11e9-9317-37d71185491a.png)\r\n\r\n**Expected behaviours**\r\nLong after the attack was over, all nodes can sync blocks normally.\r\n\r\n**What actually happened**\r\nAfter routing attack,one node gets block error when sync block.\r\n\r\n**Additional information**\r\nIf possible, include a minimal, complete, and verifiable example to help us identify the issue. This also helps check that the issue is not with your own code.\r\n",
