            "body": "**Brief of the issue**\r\nRemove the feature of sendBlock limit handler\r\n\r\n**Expected behaviours**\r\nIn the current version, the code sets the handler to limit the speed of handling sendBlock message because every chain has its mutex to ensure the consistent state of ledger, so we thought it was useless to receive many sendBlock messages before, the truth tells me that the action to limit the speed of handling sendBlock message is not fitting.\r\n\r\n**What actually happened**\r\nDescribe what actually happened. Include the full traceback if there was an exception.\r\nWhen the xchain node receives many sendBlock message at the short time, It will print the following message:\r\n![image](https://user-images.githubusercontent.com/10758120/61199933-5b07d280-a712-11e9-861b-af21eb8001e7.png)\r\n",
