            "body": "**Brief of the issue**\r\nisauthentication: true \r\nSome nodes do not synchronize blocks properly.\r\nLog Error Information\uff1a\r\n![image](https://user-images.githubusercontent.com/51076943/60949950-cb84ad00-a328-11e9-9c8d-799743182baf.png)\r\n**Your environment**\r\nxchain-cli version v3.2-e906728\r\n\r\n**Repo steps**\r\nstep1\r\nOpen configuration switches such as isauthentication: true.\r\nstep2\r\nRestart the node and observe the height. Discovering that some nodes are no longer synchronized blocks.\r\nstep3\r\n./bin/xchain-cli status \r\nView the status of the node through the above method,we find that the peers  are all their own wrong nodes.\r\n![image](https://user-images.githubusercontent.com/51076943/60950578-00453400-a32a-11e9-9609-5be11f20c2af.png)\r\n\r\n**Expected behaviours**\r\nDescribe what you expected to happen.\r\n\r\n**What actually happened**\r\nDescribe what actually happened. Include the full traceback if there was an exception.\r\n\r\n**Additional information**\r\nIf possible, include a minimal, complete, and verifiable example to help us identify the issue. This also helps check that the issue is not with your own code.\r\n",
