            "body": "**Brief of the issue**\r\nFailure of node authentication results in slow return of getting systemstatus for other nodes.\r\n\r\n**Your environment**\r\nXuperUnion and OS/Go/gcc version etc.\r\n\r\n**Repo steps**\r\nstep1\r\nChange code: s.isAuth = false\r\nstep2\r\nOne node deployment the environment,such as the above.\r\nstep3\r\nThe other nodes get systemstatus and return delay about 3 seconds.\r\nThe peers of other nodes have the bad node ip.\r\n\r\n**Expected behaviours**\r\nOther nodes are not affected by this node.\r\n\r\n**What actually happened**\r\nThe other nodes get systemstatus and return delay about 3 seconds.\r\n\r\n**Additional information**\r\nIf possible, include a minimal, complete, and verifiable example to help us identify the issue. This also helps check that the issue is not with your own code.\r\n",
