            "state": "open",
            "body": "**Brief of the issue**\r\nfunc (uv *UtxoVM) PreExec(req *pb.InvokeRPCRequest, hd *global.XContext)\r\nif the req is nil,the requested node will panic.\r\n\r\n**Your environment**\r\nxchain-cli version v3.1-391f49\r\n\r\n**Repo steps**\r\nstep1\r\nDeploy the environment of v3.1\r\nstep2\r\nUse xchain-cli of v3.2 to send requests to create a parallel chain.\r\nstep3\r\nnode will panic because the parameter req of function  PreExec is nil :\r\n![image](https://user-images.githubusercontent.com/51076943/61381250-5b07fe00-a8dd-11e9-8210-144f7ce3374a.png)\r\n\r\n**Expected behaviours**\r\nThe node will node panic.\r\n\r\n**What actually happened**\r\nDescribe what actually happened. Include the full traceback if there was an exception.\r\n\r\n**Additional information**\r\nIf possible, include a minimal, complete, and verifiable example to help us identify the issue. This also helps check that the issue is not with your own code.\r\n",
