            "state": "open",
            "body": "**Brief of your idea**\r\n\r\nNowdays, XuperChain uses longest chain rule to process fork. But it may not fit for all kinds of consensus.\r\n\r\n**What could be better if XuperChain using your idea**\r\nIts better for XuperChain to support  an interface `GetHeaviestChain` of `ConsensusInterface` so that different consensus can define its rule to process fork.\r\n\r\n**Are there any side effects?**\r\nDescribe what might be worse.\r\n\r\n**Additional information**\r\nIf possible, include a minimal, complete, and verifiable example to help us identify the issue. \r\n",
