            "body": "**Brief of the issue**\r\nWhen I run  consensus/tdpos/run_test.go \uff0cI have a problem about plugin\r\n**Your environment**\r\nUbuntu 16.04  gcc 5.4.0 go 1.12.5\r\n**Repo steps**\r\n When I tested it,\r\nhttps://github.com/xuperchain/xuperunion/blob/04264af277c5d8feb124eb288960b2416ad9a8d9/consensus/tdpos/run_test.go#L124\r\n**What actually happened**\r\nI met\r\nt=2019-07-29T00:40:24-0700 lvl=trce msg=\"Plugin conf load successfully!\" module=pluginmgr pluginCount=6\r\nt=2019-07-29T00:40:24-0700 lvl=warn msg=\"Warn: plugin open failed!\" module=pluginmgr pluginname=kv err=\"plugin.Open(\\\"plugins/kv/kv-ldb-single.so.1.0.0\\\"): plugin was built with a different version of package math/bits\"\r\nt=2019-07-29T00:40:25-0700 lvl=trce msg=\"Plugin conf load successfully!\" module=pluginmgr pluginCount=6\r\nt=2019-07-29T00:40:25-0700 lvl=warn msg=\"Warn: plugin open failed!\" module=pluginmgr pluginname=kv err=\"plugin.Open(\\\"plugins/kv/kv-ldb-single.so.1.0.0\\\"): plugin was built with a different version of package math/bits\"\r\nt=2019-07-29T00:42:32-0700 lvl=trce msg=\"Plugin conf load successfully!\" module=pluginmgr pluginCount=6\r\nt=2019-07-29T00:42:32-0700 lvl=trce msg=\"Load a plugin successfully\" module=pluginmgr name=kv subtype=default\r\nt=2019-07-29T00:42:32-0700 lvl=warn msg=\"Warn: plugin open failed!\" module=pluginmgr pluginname=crypto err=\"plugin.Open(\\\"plugins/crypto/crypto-default.so.1.0.0\\\"): plugin was built with a different version of package github.com/xuperchain/xuperunion/pb\"\r\n\r\nIs it possible that I have two different copies of package\uff0cbut I do not find it.",
