            "state": "closed",
            "body": "**Brief of your idea**\r\n1. The transaction verification workflow is scrappy and unclear.\r\n2. In some cases we calc digest hash and identify address several times, this could effects verification performance.\r\n3. The permission tree stop signature check when the permission is enough, this could be risks for contract sdk to expose initiator and authRequire to user contract.\r\n\r\n**What could be better if XuperChain using your idea**\r\nRefine transcation verification workflow, and check all signatures ahead of permission check.\r\n\r\n\r\n**Are there any side effects?**\r\nNope\r\n\r\n",
