            "author_association": "MEMBER",
            "closed_at": "2019-08-07T13:00:04Z",
            "assignee": null,
            "state": "closed",
            "body": "**Brief of your idea**\r\nWe introduced core peers' connection in V3.2 to enhance core network security and provide directly connections for BFT-like consensus.\r\n\r\nBut is V3.2, we didn't force check the 'neturl' configuration when **coreConnection** set to **true**. This could be  a potential risk if we set coreConnection to true but no neturl info, though the system could still work, but the BFT-like consensus would suffering from multi-jump connections for high latency and unstable network conditions.\r\n\r\n**What could be better if XuperChain using your idea**\r\nForce check the neturl when coreConnection set to true.\r\n\r\n**Are there any side effects?**\r\nNo",
