            "body": "**Brief of the issue**\r\nMore forbidden causes the balance of address  to be unavailable.\r\n\r\n**Your environment**\r\nXuperUnion and OS/Go/gcc version etc.\r\n\r\n**Repo steps**\r\nstep1\r\nPerforming a transaction does not affect local utxo usage.\r\nstep2\r\nMore forbidden causes the balance of address  to be unavailable.And all forbidden were unsuccessful.\r\nstep3\r\nLocal utxo is unavailable.\r\n![image](https://user-images.githubusercontent.com/51076943/61772921-f8a38600-ae25-11e9-86c1-490ebc197cc4.png)\r\n\r\n**Expected behaviours**\r\nDescribe what  you expected to happen.\r\n\r\n**What actually happened**\r\nDescribe what actually happened. Include the full traceback if there was an exception.\r\n\r\n**Additional information**\r\nIf possible, include a minimal, complete, and verifiable example to help us identify the issue. This also helps check that the issue is not with your own code.\r\n",
