            "body": "**Brief of the issue**\r\nDescribe here\r\nall child DAGs don't sort separately\r\nExample:\r\nInput: \r\ngraph[\"tx3\"] = []string{\"t1\", \"t2\"}\r\ngraph[\"t4\"] = []string{\"t5\", \"t6\"}\r\nOutput:\r\nTheory output is []string{\"t3\",\"t1\",\"t2\", \"t4\",\"t5\",\"t6\"} that means different child DAGs should arrage separately.\r\nActual output may be []string{\"t4\",\"t3\",\"t6\",\"t5\",\"t2\",\"t1\"}, Thought it doesn't affect the result for current system, it may affect the result when running multiple child DAGs with different go routine.\r\n\r\n",
