            "assignee": null,
            "state": "closed",
            "body": "**Brief of the issue**\r\nMessages sent from unauthenticated nodes to authenticated  nodes should be refused.\r\nBut now,The messages sent from unauthenticated nodes to authenticated  nodes can be accepted.\r\n\r\n**Your environment**\r\nxchain-cli version V3.2\r\n\r\n**Repo steps**\r\nstep1 \r\nTurn off authentication switches for all nodes.\r\nstep2\r\nOpen the authentication switch for one of the nodes.\r\nstep3\r\nObserving the heights of all nodes, it is found that the node with the switch on can receive messages.\r\n\r\n**Expected behaviours**\r\nMessages sent from unauthenticated nodes to authenticated  nodes should be refused.\r\n\r\n**What actually happened**\r\nNow,The messages sent from unauthenticated nodes to authenticated  nodes can be accepted.\r\n\r\n**Additional information**\r\nIf possible, include a minimal, complete, and verifiable example to help us identify the issue. This also helps check that the issue is not with your own code.\r\n",
            "milestone": null,
