            "active_lock_reason": null,
            "assignees": [],
            "author_association": "CONTRIBUTOR",
            "closed_at": "2019-08-19T02:20:19Z",
            "assignee": null,
            "state": "closed",
            "body": "**Brief of the issue**\r\nThe API of PreExecWithSelectUTXO supports only a call for the client to get the utxo for PreExec.\r\n\r\nIn the latest version, you have to have a first call of PreExec to get the amount of GasUsed and have another call of SelectUTXO to get the utxoOutput when you want to post a transaction, such as create an contract account.\r\n\r\nHowever, when the API of PreExecWithSelectUTXO is available, you need only one call to finish the work above.\r\n",
