            "body": "**Brief of the issue**\r\npanic: Value log truncate required to run DB. This might result in data loss.\r\n\r\n**Your environment**\r\nxchain version v3.2-048bebf\r\n\r\n**Repo steps**\r\nstep1\r\n    When the space is not enough, badger throws a panic.\r\n    panic\uff1aruntime error: slice bounds out of range\r\nstep2\r\n    After clearing the disk space, I restart the node.But the node still throws a panic.\r\n    panic:  Value log truncate required to run DB. This might result in data loss\r\n![image](https://user-images.githubusercontent.com/51076943/63663476-1a14da80-c7f5-11e9-9a4c-97f2d5f99e06.png)\r\n\r\n**Expected behaviours**\r\nWhen the space is enough,I restart the node that can run normally.\r\n\r\n**What actually happened**\r\nThe node throws a panic.\r\n**Additional information**\r\nIf possible, include a minimal, complete, and verifiable example to help us identify the issue. This also helps check that the issue is not with your own code.\r\n",
