            "body": "**Brief of the issue**\r\nHi there, I am trying the xuperchain.\r\nI run an xuperchain, single node in ubuntu.  I can get chain info like balance, block by xchain-cli console as following.\r\n./xchain-cli block a64926ebe7bf97f28fddf1aacd4d3338e1d84a44f69ccbb8ae962228b12ba399 -H 192.168.0.23:37101\r\nIt works.\r\n\r\nBut I cannot access rpc interface by http post method.\r\nFor example:\r\ncurl -X POST http://127.0.0.1:37101/v1/get_block -d BlockID=a64926ebe7bf97f28fddf1aacd4d3338e1d84a44f69ccbb8ae962228b12ba399\r\nThe result is:\r\ncurl: (56) Recv failure: Connection reset by peer\r\n\r\nIs there anything I should pay attention to?\r\n\r\nThanks!\r\n\r\n**Your environment**\r\nXuperUnion: \r\nOS: ubuntu 16.04\r\nGo: go version go1.12.9 linux/amd64\r\n\r\n**Repo steps**\r\ncurl -X POST http://127.0.0.1:37101/v1/get_block -d BlockID=a64926ebe7bf97f28fddf1aacd4d3338e1d84a44f69ccbb8ae962228b12ba399\r\n\r\n**Expected behaviours**\r\nThe block info.\r\n\r\n**What actually happened**\r\ncurl: (56) Recv failure: Connection reset by peer\r\n\r\n**Additional information**\r\n\r\n",
