            "state": "closed",
            "body": "## Brief of your idea\r\nSupport Multisignature in default/schnorr crypto client, so that client could generate real multi signature which contains only one signature for several private keys.\r\n\r\nFor Multisignature please referring to [wikipedia](https://en.wikipedia.org/wiki/Multisignature)\r\n\r\n## What could be better if XuperChain using your idea\r\nUsing multisig could improve the performance of validating a group of user's signatures. Without multisign, we need validate N signatures for a group of N users, but with multisig, we only need to verify one signature\r\n\r\n## Are there any side effects?\r\nMore complicated for cli to preparing multisig\r\n\r\n",
