            "state": "closed",
            "body": "**Brief of the issue**\r\nThe nomination of tdpos that candidate mismatches neturl can succeed\r\n\r\n**Your environment**\r\nXuperUnion and OS/Go/gcc version etc.\r\n\r\n**Repo steps**\r\nsetp1\r\nNominate.json that candidate mismatches neturl\r\nstep2\r\n./xchain-cli multisig gen --to=$addr --desc=./nominate.json --multiAddrs=./data/acl/addrs --amount=$amount --frozen=-1\r\nsign tx.out\r\nsend tx.out\r\nstep3\r\nThe nomination was successful.\r\nstep4\r\nVote the candidate and then find the vote successfully.\r\n\r\n**Expected behaviours**\r\nDescribe what you expected to happen.\r\n\r\n**What actually happened**\r\n\r\n**Additional information**\r\nIf possible, include a minimal, complete, and verifiable example to help us identify the issue. This also helps check that the issue is not with your own code.\r\n",
