                    "author_association": "MEMBER",
                    "body": "Seems by design.\r\n\r\n1. Nominating candidate should include the signature of the candidate, so it's the candidate's responsible to check the netURL.\r\n2. Other nodes cannot know the information of the candidate. For example, we can nominate a node that when it's still offline. It's just the same with the candidate's address, we have no responsibility and hardly to check whether the address is valid.\r\n3. If the candidate info is changed after nomination, user can revoke the nomination and nominate with correct info again.",
