            "body": "**Brief of the issue**\r\nA linked list is used in `SelectUtxos` to trace the expiration of utxo temporary locks. However, when a select action fails because of no enough utxo, the unlock function will not delete the element in linked list. As a result, memory leak happens.\r\n\r\n**Your environment**\r\nXuperUnion and OS/Go/gcc version etc.\r\n\r\n**Repo steps**\r\nDescribe how to reproduce this issue.\r\n\r\n**Expected behaviours**\r\nDescribe what you expected to happen.\r\n\r\n**What actually happened**\r\nDescribe what actually happened. Include the full traceback if there was an exception.\r\n\r\n**Additional information**\r\nIf possible, include a minimal, complete, and verifiable example to help us identify the issue. This also helps check that the issue is not with your own code.\r\n",
