            "state": "closed",
            "body": "**Brief of the issue**\r\n\r\nIf the deployment of the contract fails with some error and not due to the contract itself, in order to speed up the execution of the contract, the cache of the contract is saved at this time. After deploying again, a new contract code is used. Since the previous contract handle is not cleaned up, dlopen will use the previous dlhandle, and since the old so file is overwritten, the kernel will reclaim the memory space of the previous so file mmap. As a result, the new dlhandle has a memory error when calling dlsym.\r\n\r\n**Your environment**\r\nXuperUnion: 3.2 \r\nOS: linux 2.6.32\r\nGo: 1.12\r\ngcc: 4.8.2\r\n\r\n**Repo steps**\r\n`./xchain-cli wasm deploy --account XC1111111111111111@xuper --cname counter2 counter_v1.wasm -a '{\"creator\":\"icexin\"}'`\r\nSince the fee is not set here, the deployment will fail. Continue deployment with a new version of the contract.\r\n`./xchain-cli wasm deploy --account XC1111111111111111@xuper --cname counter2 counter_v2.wasm -a '{\"creator\":\"icexin\"}'` --fee 144194\r\n\r\nxchain panics.\r\n\r\n**Expected behaviours**\r\n\r\nNew contract successfully deployed.\r\n\r\n**What actually happened**\r\n\r\nXchain panics with following tracing stack:\r\n\r\n```\r\nfatal error: unexpected signal during runtime execution\r\n[signal SIGBUS: bus error code=0x2 addr=0x7f08b0d20800 pc=0x7f08bf2417e3]\r\n\r\nruntime stack:\r\nruntime.throw(0x158ec62, 0x2a)\r\n        /home/fanbingxin/local/go1.12.5/src/runtime/panic.go:617 +0x72\r\nruntime.sigpanic()\r\n        /home/fanbingxin/local/go1.12.5/src/runtime/signal_unix.go:374 +0x4a9\r\n\r\ngoroutine 111 [syscall]:\r\nruntime.cgocall(0x12c9b80, 0xc0004bf158, 0x14b9be0)\r\n        /home/fanbingxin/local/go1.12.5/src/runtime/cgocall.go:128 +0x5b fp=0xc0004bf100 sp=0xc0004bf0c8 pc=0x93b50b\r\ngithub.com/xuperchain/xuperunion/xvm/exec._Cfunc_xvm_new_code(0x7f089c001690, 0x2, 0x12c9980, 0x12c99e0, 0x12c9a40, 0x0)\r\n        _cgo_gotypes.go:263 +0x51 fp=0xc0004bf158 sp=0xc0004bf100 pc=0xf4b1c1\r\ngithub.com/xuperchain/xuperunion/xvm/exec.NewCode.func4(0x7f089c001690, 0x2, 0x12c9980, 0x12c99e0, 0x12c9a40, 0xf58c22)\r\n        /home/fanbingxin/go/src/github.com/xuperchain/xuperunion/xvm/exec/code.go:41 +0xc8 fp=0xc0004bf1b8 sp=0xc0004bf158 pc=0xf4dda8\r\ngithub.com/xuperchain/xuperunion/xvm/exec.NewCode(0xc003fe4480, 0x2f, 0x18067e0, 0xc003fe7280, 0xc003fe72a0, 0x0, 0x0)\r\n        /home/fanbingxin/go/src/github.com/xuperchain/xuperunion/xvm/exec/code.go:41 +0x210 fp=0xc0004bf238 sp=0xc0004bf1b8 pc=0xf4b930\r\ngithub.com/xuperchain/xuperunion/contract/wasm/vm/xvm.(*xvmCreator).MakeExecCode(0xc00041eb40, 0xc003fe4480, 0x2f, 0x0, 0xc003fe4450, 0x27)\r\n        /home/fanbingxin/go/src/github.com/xuperchain/xuperunion/contract/wasm/vm/xvm/creator.go:109 +0x159 fp=0xc0004bf2a8 sp=0xc0004bf238 pc=0xf5b749\r\ngithub.com/xuperchain/xuperunion/contract/wasm/vm/xvm.(*xvmCreator).MakeExecCode-fm(0xc003fe4480, 0x2f, 0x1567366, 0x9, 0xc00034a980)\r\n        /home/fanbingxin/go/src/github.com/xuperchain/xuperunion/contract/wasm/vm/xvm/creator.go:104 +0x3e fp=0xc0004bf2e8 sp=0xc0004bf2a8 pc=0xf5e05e\r\ngithub.com/xuperchain/xuperunion/contract/wasm/vm/xvm.(*codeManager).makeMemCache(0xc0003ad7d0, 0xc0003207f0, 0x8, 0xc003fe4480, 0x2f, 0xc000274f50, 0x22000, 0xc003fe4480, 0x2f)\r\n        /home/fanbingxin/go/src/github.com/xuperchain/xuperunion/contract/wasm/vm/xvm/code_manager.go:61 +0x42 fp=0xc0004bf338 sp=0xc0004bf2e8 pc=0xf599d2\r\ngithub.com/xuperchain/xuperunion/contract/wasm/vm/xvm.(*codeManager).GetExecCode(0xc0003ad7d0, 0xc0003207f0, 0x8, 0x1804620, 0xc003af7c70, 0x0, 0x0, 0x0)\r\n        /home/fanbingxin/go/src/github.com/xuperchain/xuperunion/contract/wasm/vm/xvm/code_manager.go:160 +0x37b fp=0xc0004bf3d0 sp=0xc0004bf338 pc=0xf5a77b\r\ngithub.com/xuperchain/xuperunion/contract/wasm/vm/xvm.(*xvmCreator).getContractCodeCache(...)\r\n        /home/fanbingxin/go/src/github.com/xuperchain/xuperunion/contract/wasm/vm/xvm/creator.go:101\r\ngithub.com/xuperchain/xuperunion/contract/wasm/vm/xvm.(*xvmCreator).CreateInstance(0xc00041eb40, 0xc00028d170, 0x1804620, 0xc003af7c70, 0xd, 0x10, 0xc003b9c000, 0x21884)\r\n        /home/fanbingxin/go/src/github.com/xuperchain/xuperunion/contract/wasm/vm/xvm/creator.go:113 +0x78 fp=0xc0004bf468 sp=0xc0004bf3d0 pc=0xf5b868\r\ngithub.com/xuperchain/xuperunion/contract/wasm.(*VMManager).DeployContract(0xc00008a6c0, 0xc000274d20, 0xc003b2a840, 0xc003b303e0, 0x18, 0x20, 0xc00378cff0, 0x0, 0x0, 0x20c0ce0)\r\n        /home/fanbingxin/go/src/github.com/xuperchain/xuperunion/contract/wasm/vm_manager.go:176 +0x5a7 fp=0xc0004bf5d0 sp=0xc0004bf468 pc=0xf5ffd7\r\ngithub.com/xuperchain/xuperunion/contract/kernel.(*DeployMethod).Invoke(0xc000472a38, 0xc003afca80, 0xc003b2a840, 0x6, 0xc0003ef3e8, 0x80)\r\n        /home/fanbingxin/go/src/github.com/xuperchain/xuperunion/contract/kernel/deploy.go:35 +0x4e7 fp=0xc0004bf778 sp=0xc0004bf5d0 pc=0x11c90e7\r\ngithub.com/xuperchain/xuperunion/contract/kernel.(*KContext).Invoke(0xc003afca80, 0xc0003204b0, 0x6, 0xc003b2a840, 0x0, 0x0, 0x1)\r\n        /home/fanbingxin/go/src/github.com/xuperchain/xuperunion/contract/kernel/kernel3.go:71 +0x8d fp=0xc0004bf7f0 sp=0xc0004bf778 pc=0x11d0ead\r\ngithub.com/xuperchain/xuperunion/utxo.(*UtxoVM).PreExec(0xc000424380, 0xc003afc900, 0xc000171a98, 0xc0004d81c0, 0x2, 0x2)\r\n        /home/fanbingxin/go/src/github.com/xuperchain/xuperunion/utxo/utxo.go:755 +0xabe fp=0xc0004bfa20 sp=0xc0004bf7f0 pc=0xf79aee\r\ngithub.com/xuperchain/xuperunion/core.(*XChainCore).PreExec(...)\r\n        /home/fanbingxin/go/src/github.com/xuperchain/xuperunion/core/xchaincore.go:1153\r\n```",
