            "body": "## Brief of your idea\r\n\r\nIn many cases, a full node could be used for Endorser service. For example, an endorser service can provide delegated computing and compliance check for transactions,  and set an endorser fee for each request.\r\n\r\nEndorser fee is a transfer transaction from user to endorser's address. By using fee, endorser service could avoid some garbage requests or attacks and get reward of endorsement.\r\n\r\n## What could be better if XuperChain using your idea\r\n\r\nEndorser protocol provide standard interface for endorser operations , endorser service provider could decide how much fee needed for each operation.\r\n\r\n## Are there any side effects?\r\nDescribe what might be worse.\r\n\r\n## Additional information\r\nIf possible, include a minimal, complete, and verifiable example to help us identify the issue. \r\n",
