            "state": "closed",
            "body": "**Brief of the issue**\r\nWhen I wrote the GRPC client of XuperChain, I found that GRPC had a type error at compile time, because different GRPC packages were referenced. After using `vendor`, I found that the dependencies were abnormal.\r\n\r\n**Your environment**\r\nOS: Linux xuperunion 4.4.0-146-generic #172-Ubuntu SMP Wed Apr 3 09:00:08 UTC 2019 x86_64 x86_64 x86_64 GNU/Linux\r\nGo Version: 1.12.6\r\nGCC Version: 5.4.0\r\n\r\n**Repo steps**\r\n\r\n\r\n**Expected behaviours**\r\nnull\r\n\r\n**What actually happened**\r\n./client.go:16:30: cannot use conn (type *\"google.golang.org/grpc\".ClientConn) as type *\"github.com/xuperchain/xuperunion/vendor/google.golang.org/grpc\".ClientConn in argument to pb.NewXchainClient\r\n\r\n**Additional information**\r\n```\r\npackage main\r\n\r\nimport (\r\n\t\"golang.org/x/net/context\"\r\n\t\"crypto/tls\"\r\n\t\"crypto/x509\"\r\n\t\"io/ioutil\"\r\n\t\"log\"\r\n\t\"github.com/xuperchain/xuperunion/vendor/google.golang.org/grpc\"\r\n\t\"github.com/xuperchain/xuperunion/vendor/google.golang.org/grpc/credentials\"\r\n\tpb \"github.com/xuperchain/xuperunion/pb\"\r\n)\r\n\r\nfunc main() {\r\n\tcert, err := tls.LoadX509KeyPair(\"certs/test_client.pem\", \"certs/test_client.key\")\r\n\tif err != nil {\r\n\t\tpanic(err)\r\n\t}\r\n\r\n\t// \u5c06\u6839\u8bc1\u4e66\u52a0\u5165\u8bc1\u4e66\u6c60\r\n\tcertPool := x509.NewCertPool()\r\n\tbs, err := ioutil.ReadFile(\"certs/root.pem\")\r\n\tif err != nil {\r\n\t\tpanic(err)\r\n\t}\r\n\r\n\tif !certPool.AppendCertsFromPEM(bs) {\r\n\t\tpanic(\"cc\")\r\n\t}\r\n\r\n\t// \u65b0\u5efa\u51ed\u8bc1\r\n\ttransportCreds := credentials.NewTLS(&tls.Config{\r\n\t\tServerName:   \"xuper\",\r\n\t\tCertificates: []tls.Certificate{cert},\r\n\t\tRootCAs:      certPool,\r\n\t})\r\n\r\n\tdialOpt := grpc.WithTransportCredentials(transportCreds)\r\n\r\n\tconn, err := grpc.Dial(\"127.0.0.1:37102\", dialOpt)\r\n\tif err != nil {\r\n\t\tlog.Fatalf(\"Dial failed:%v\", err)\r\n\t}\r\n\tdefer conn.Close()\r\n\r\n\tclient := pb.NewXchainClient(conn)\r\n\tresp2, err := client.GetBlockChains(context.Background(), &pb.CommonIn{\r\n\t\tHeader: nil,\r\n\t})\r\n\r\n\tif err != nil {\r\n\t\tlog.Fatalf(\"%v\", err)\r\n\t}\r\n\tlog.Printf(\"Resp2:%+v\", resp2)\r\n}\r\n\r\n```",
