                    "body": "Use go module to manage project dependencies.\r\n\r\nPlace a go.mod file in the project root directory with the following contents:\r\n```\r\nmodule xclient\r\n\r\nrequire (\r\n        github.com/xuperchain/xuperunion v1.0.0\r\n        google.golang.org/grpc v1.19.0\r\n)\r\n\r\nreplace github.com/xuperchain/xuperunion v1.0.0 => $path_to_xuperunion  // eg ../xuperunion\r\n```\r\n\r\n`xclient` is the module name of your project, `$path_to_xuperunion` is the path of xuperunion.\r\n\r\nThe code using the go module is as follows:\r\n\r\n``` go\r\npackage main\r\n\r\nimport (\r\n        \"context\"\r\n        \"crypto/tls\"\r\n        \"crypto/x509\"\r\n        \"io/ioutil\"\r\n        \"log\"\r\n        \"google.golang.org/grpc\"\r\n        \"google.golang.org/grpc/credentials\"\r\n        pb \"github.com/xuperchain/xuperunion/pb\"\r\n)\r\n\r\nfunc main() {\r\n        cert, err := tls.LoadX509KeyPair(\"certs/test_client.pem\", \"certs/test_client.key\")\r\n        if err != nil {\r\n                panic(err)\r\n        }\r\n\r\n        // \u5c06\u6839\u8bc1\u4e66\u52a0\u5165\u8bc1\u4e66\u6c60\r\n        certPool := x509.NewCertPool()\r\n        bs, err := ioutil.ReadFile(\"certs/root.pem\")\r\n        if err != nil {\r\n                panic(err)\r\n        }\r\n\r\n        if !certPool.AppendCertsFromPEM(bs) {\r\n                panic(\"cc\")\r\n        }\r\n\r\n        // \u65b0\u5efa\u51ed\u8bc1\r\n        transportCreds := credentials.NewTLS(&tls.Config{\r\n                ServerName:   \"xuper\",\r\n                Certificates: []tls.Certificate{cert},\r\n                RootCAs:      certPool,\r\n        })\r\n\r\n        dialOpt := grpc.WithTransportCredentials(transportCreds)\r\n\r\n        conn, err := grpc.Dial(\"127.0.0.1:37102\", dialOpt)\r\n        if err != nil {\r\n                log.Fatalf(\"Dial failed:%v\", err)\r\n        }\r\n        defer conn.Close()\r\n\r\n        client := pb.NewXchainClient(conn)\r\n        resp2, err := client.GetBlockChains(context.Background(), &pb.CommonIn{\r\n                Header: nil,\r\n        })\r\n\r\n        if err != nil {\r\n                log.Fatalf(\"%v\", err)\r\n        }\r\n        log.Printf(\"Resp2:%+v\", resp2)\r\n}\r\n```",
