                    "body": "> What's the output of go build?\r\n> What's the content of your go.mod file?\r\n\r\nI reset the code.\r\nThe gopath directory is as follows:\r\n```\r\nXuperunion:gopath# pwd\r\n/opt/x/gopath\r\n```\r\nThe client directory is as follows:\r\n```\r\nXuperunion:client# pwd\r\n/opt/xu/client\r\n```\r\nThe xuperunion directory is as follows:\r\n```\r\nXuperunion# pwd\r\n/opt/xu/xuperunion\r\n```\r\n\r\n**The client directory is as follows:**\r\nXuperunion:client# tree\r\n.\r\n\u251c\u2500\u2500 client.go\r\n\u2514\u2500\u2500 go.mod\r\n\r\n**Client.go content:**\r\nXuperunion:client# cat client.go\r\n```\r\nPackage main\r\n\r\nImport (\r\n\"context\"\r\n\"io/ioutil\"\r\n\"log\"\r\n\"google.golang.org/grpc\"\r\nPb \"github.com/xuperchain/xuperunion/pb\"\r\n)\r\n\r\nFunc main() {\r\nConn, err := grpc.Dial(\"localhost:37102\", grpc.WithInsecure())\r\nIf err != nil {\r\nlog.Fatalf(\"Dial failed:%v\", err)\r\n}\r\nDefer conn.Close()\r\nClient := pb.NewXchainClient(conn)\r\nResp2, err := client.GetBlockChains(context.Background(), &pb.CommonIn{\r\nHeader: nil,\r\n})\r\n\r\nIf err != nil {\r\nlog.Fatalf(\"%v\", err)\r\n}\r\nlog.Printf(\"Resp2:%+v\", resp2)\r\n}\r\n```\r\n\r\n\r\nXuperunion:client# cat go.mod\r\n```\r\nModule client\r\n\r\nGo 1.12\r\n\r\nRequire (\r\nGithub.com/xuperchain/xuperunion v0.0.0-20190828095804-498fb601ef74\r\nGoogle.golang.org/grpc v1.19.0\r\n)\r\n```\r\n\r\nerror:\r\n`xuperunion:client# go run client.go `\r\n```\r\n...\r\ngo: finding gopkg.in/yaml.v2 v2.2.2\r\ngo: github.com/libp2p/go-libp2p-netutil@v0.4.12: unknown revision v0.4.12\r\ngo: github.com/libp2p/go-libp2p-nat@v0.8.8: unknown revision v0.8.8\r\ngo: finding github.com/multiformats/go-multistream v0.3.9\r\ngo: finding github.com/coreos/go-semver v0.2.0\r\ngo: github.com/libp2p/go-stream-muxer@v3.0.1+incompatible: unknown revision v3.0.1\r\ngo: finding github.com/spf13/afero v1.1.2\r\ngo: github.com/libp2p/go-libp2p-kbucket@v2.2.12+incompatible: unknown revision v2.2.12\r\ngo: finding github.com/magiconair/properties v1.8.0\r\ngo: github.com/libp2p/go-libp2p-record@v4.1.7+incompatible: unknown revision v4.1.7\r\ngo: finding github.com/libp2p/go-libp2p-routing v2.7.1+incompatible\r\ngo: github.com/ipfs/go-todocounter@v1.0.1: unknown revision v1.0.1\r\ngo: finding github.com/libp2p/go-libp2p-protocol v1.0.0\r\ngo: github.com/multiformats/go-multistream@v0.3.9: unknown revision v0.3.9\r\ngo: github.com/libp2p/go-libp2p-protocol@v1.0.0: unknown revision v1.0.0\r\ngo: github.com/libp2p/go-libp2p-routing@v2.7.1+incompatible: unknown revision v2.7.1\r\ngo: error loading module requirements\r\n```\r\n\r\n\r\n\r\n",
