            "body": "**Brief of the issue**\r\nWhen switching miners, the ledger is frequently split.\r\n\r\n**Your environment**\r\nXuperUnion and OS/Go/gcc version etc.\r\n\r\n**Repo steps**\r\nstep1 \r\nCreate a chain used consence of tdpos with BFT.\r\nstep2\r\nYou can make a transaction with more utxo.\r\nstep3\r\nAnd then, you can get the height of the ledger.You will find that the height stop getting higher.\r\nThe ledger is as follows:\r\n![image](https://user-images.githubusercontent.com/51076943/65297527-cb135880-db9a-11e9-941c-10ce3ca049fc.png)\r\n\r\n\r\n**Expected behaviours**\r\nMiners can switch normally.\r\n\r\n**What actually happened**\r\nDescribe what actually happened. Include the full traceback if there was an exception.\r\n\r\n**Additional information**\r\nIf possible, include a minimal, complete, and verifiable example to help us identify the issue. This also helps check that the issue is not with your own code.\r\n",
