            "state": "closed",
            "body": "**Brief of your idea**\r\nCurrently, plugin loading is according to a configuration file which contains the meta info of all plugins such as plugins' type and binary path. The framework can only use the plugins listed in config file and need to explicitly declare which plugin would be loaded in a hardcode way.\r\n\r\nIt's not convenient to extend XuperChain using 3rd party plugins without auto-loading mechanism. for example, using etcd as a keep-alive service require register each node's info into etcd server, user can implement a 3rd plugin with autoload mechanism and the etcd service is automatically started after Xuperchain node was initialized.\r\n\r\n**What could be better if XuperChain using your idea**\r\nAuto-load mechanism and system events could provide more extensibility for XuperChain developers.\r\n\r\n**Are there any side effects?**\r\nDescribe what might be worse.\r\n\r\n**Additional information**\r\nIf possible, include a minimal, complete, and verifiable example to help us identify the issue. \r\n",
