            "state": "closed",
            "body": "**Brief of your idea**\r\nXRCs  are technical documents used by smart contract developers at XuperChain.\r\n\r\nXRC-01 is a multi token standard used for smart contracts on the XuperChain blockchain. It's can include combination of fungible and non-fungible tokens in one contract. The default asset transferor is the contract initiator.\r\n\r\nSmart contracts implementing the XRC-01 standard can just implement the interface they needed. The main interfaces of this standard are as following:\r\n\r\n- issue\r\n- authorization\r\n- withdraw_authorization \r\n- transfer\r\n- transfer_from\r\n- get_balance\r\n- get_authorized\r\n- owner_of\r\n- authorize_infos\r\n- authorized_infos\r\n\r\n**What could be better if XuperChain using your idea**\r\nUsers can map offline assets to online assets easily. \r\n\r\n**Are there any side effects?**\r\nUse table to store asset information. May cause write amplification.\r\n",
