            "body": "**Brief of the issue**\r\nContract permission check doesn't include initiator, contract call would be failed since ACL not enough.\r\n\r\n**Your environment**\r\nXuperUnion master\r\n\r\n**Repo steps**\r\n1. Set ACL to a contact interface, give address A permission to call the interface.\r\n2. Invoke or query the interface with address A in as initiator, keep clear of auth_require.\r\n\r\n**Expected behaviours**\r\nHave permission to call the interface\r\n\r\n**What actually happened**\r\nReturned ACL_NOT_ENOUGH error\r\n\r\n**Additional information**\r\nIf possible, include a minimal, complete, and verifiable example to help us identify the issue. This also helps check that the issue is not with your own code.\r\n",
