            "state": "closed",
            "body": "**Brief of your idea**\r\n\r\nNow in XuperChain, a new block is broadcasted in full block data mode. Nodes broadcast block data to all neighbours and the neighbours broadcast it again, duplicate block data cannot be checked unless the node received whole block data, this lead to a significant bandwidth cost. \r\n\r\nSo we plan to reduce duplicate block broadcast to save bandwidth and computing resources.\r\n\r\n**What could be better if XuperChain using your idea**\r\n\r\nUse interactive block broadcast mode: nodes only broadcast new block id, the receiver node Get Block data only if the block is not exist in its ledger.\r\n\r\n**Are there any side effects?**\r\nDescribe what might be worse.\r\n\r\n**Additional information**\r\nIf possible, include a minimal, complete, and verifiable example to help us identify the issue. \r\n",
