            "title": "PoA Consensus Implementation",
            "created_at": "2019-12-26T08:40:44Z",
            "user": {
                "repos_url": "https://api.github.com/users/DhunterAO/repos",
                "login": "DhunterAO",
                "organizations_url": "https://api.github.com/users/DhunterAO/orgs",
                "html_url": "https://github.com/DhunterAO",
                "following_url": "https://api.github.com/users/DhunterAO/following{/other_user}",
                "avatar_url": "https://avatars.githubusercontent.com/u/13730168?v=4",
                "url": "https://api.github.com/users/DhunterAO",
                "received_events_url": "https://api.github.com/users/DhunterAO/received_events",
                "id": 13730168,
                "gists_url": "https://api.github.com/users/DhunterAO/gists{/gist_id}",
                "followers_url": "https://api.github.com/users/DhunterAO/followers",
                "site_admin": false,
                "type": "User",
                "subscriptions_url": "https://api.github.com/users/DhunterAO/subscriptions",
                "events_url": "https://api.github.com/users/DhunterAO/events{/privacy}",
                "node_id": "MDQ6VXNlcjEzNzMwMTY4",
                "starred_url": "https://api.github.com/users/DhunterAO/starred{/owner}{/repo}",
                "gravatar_id": ""
            },
            "active_lock_reason": null,
            "assignees": [],
            "author_association": "NONE",
            "closed_at": null,
            "assignee": null,
            "state": "open",
            "body": "**Brief of your idea**\r\nThe PoA protocol is designed for the consortium scene.\r\nThe PoA protocol focus on the management of proposers for the Chained-BFT protocol, and provides the liveness for the consensus.\r\n\r\nThe main parts of PoA are as follows:\r\n- Proposer initialization and update: The proposers in the PoA are initialized in the configuration, and then updated according to the ACL of the specific contract account, which name is also set in the configuration.\r\n- Primary alternation: Like the alternation in TDPoS, every node in the proposer set creates a certain number of blocks successively in a term. And at the start of each term, all nodes will update the proposer set with confirmed update of the ACL.\r\n- Liveness proof: When a node crashes or becomes a byzantine node, the normal nodes will vote for the next proposer. This can continue until a normal node becomes the primary.\r\n\r\n**What could be better if XuperChain using your idea**\r\nIt can be applied in more consortium scenes, and provide easy control for CA without voting in TDPoS.\r\nAlso, the liveness proof in the PoA can provide a different way from TDPoS to promise the liveness in the consensus, which can be helpful for future consensus protocols.\r\n\r\n**Are there any side effects?**\r\nThe communication in the network will be more complicated, because 2 kinds of messages will be added to prove the liveness of PoA consensus.\r\n\r\n",
