            "body": "**Brief of your idea**\r\n\u5173\u4e8e\u6570\u503c\u5355\u4f4d\u548c\u5355\u4f4d\u8f6c\u6362\u7684\u5efa\u8bae\r\n\r\n\u56e0\u4e3a\u5927\u6570\u7684\u8868\u73b0\u95ee\u9898\uff0cBigInt\u7c7b\u578b\u5e76\u4e0d\u80fd\u652f\u6301\u5c0f\u6570\u8868\u793a\uff0c\u4e3a\u4e86\u66f4\u597d\u533a\u5206\u6570\u503c\uff0c\u540c\u65f6\u4e5f\u53ef\u4ee5\u8ba9\u7528\u6237\uff0c\u5f00\u53d1\u8005\u4e0d\u7528\u957f\u65f6\u95f4\u9762\u5bf9\u8d85\u957f\u7684\u6570\u503c\uff0c\u5982\u6838\u7b97\u624b\u7eed\u8d39\u7b49\uff0c\u5efa\u8bae\u4e3a\u6bcf10 ** 3 \u589e\u52a0\u4e00\u4e2a\u5355\u4f4d\u3002\r\n\r\n\u6bd4\u5982\u4f59\u989d\u4e3a:\r\n1 = 1 (XB)\r\n1,000 = 1 (KXB)\r\n1000,000 = 1 (GXB)\r\n100,000,000 = 1 (TXB)\r\n\r\n(\u5907\u6ce8\uff1a\u5355\u4f4d\u53ea\u662f\u4e3e\u4f8b\u8bf4\u660e\uff09\r\n\r\n\u540c\u65f6\u589e\u52a0\u8f6c\u6362\u5982\uff1a\r\n\r\n\u51fd\u6570\u539f\u578b\uff1a\r\n\r\n> Units.toXB( blanace, balnaceUnit )\r\n> Units.fromXB( blanace, balnaceUnit )\r\n```\r\nUnits.toXB( 1, Units.TXB )\r\n100,000,000 (XB)\r\n\r\nUnits.toXB( 1, Units.GXB )\r\n100,000 (XB)\r\n\r\nUnits.fromXB(123456789, Units.TXB)\r\n1.234,567,89 (TXB)\r\n\r\nUnits.fromXB(123456789, Units.GXB)\r\n1,234.567,89 (GXB)\r\n```\r\n\r\n\u7136\u540e\u5728\u6240\u6709\u5e73\u53f0\u7684SDK\u4e2d\u4f5c\u51fa\u5bf9\u5e94\u5e73\u53f0\u7684\u5b9e\u73b0\uff0c\u901a\u8baf\u4e4b\u95f4\u4f7f\u7528\u7684\u5355\u4f4d\u4e00\u5f8b\u4e3a XB\uff0c\u5373\u6700\u5c0f\u5355\u4f4d\u3002",
