            "assignee": null,
            "state": "closed",
            "body": "**Brief of your idea**\r\nNow the block will be confirm in the ledger directly.\r\nAnd then, utxovm will verify tx. If dotx function failed to ImmediateVerifyTx.\r\nThe node will walk error and utxototal is not going up.\r\n\r\n**What could be better if XuperChain using your idea**\r\n\r\nBlock should firstly save in temporary ledger not realy ledger.\r\nThe block which pass ImmediateVerifyTx can be confirmed on the leadger.\r\nThis way can guarantee that the ledger of slave and master are the same,and the node which can sycblock successfuly  will not walk error.\r\n\r\n**Are there any side effects?**\r\nDescribe what might be worse.\r\n\r\n**Additional information**\r\nIf possible, include a minimal, complete, and verifiable example to help us identify the issue. \r\n",
