            "author_association": "MEMBER",
            "closed_at": "2020-02-08T03:38:51Z",
            "assignee": null,
            "state": "closed",
            "body": "**Brief of your idea**\r\n\r\nCurrently, the P2P module is not pluggable, so KAD network is the only choice of XuperChain users. But in some cases, using gossip and static nodes could be better fitting the real scenarios and requirements.\r\n\r\n**What could be better if XuperChain using your idea**\r\n\r\nWe could abstract the interface of P2P module, and use pluggable implementation to support different P2P protocols. By using pluggable design, we even could support RPC-based network to meet some private/permission blockchain scenarios.\r\n\r\n**Are there any side effects?**\r\nDescribe what might be worse.\r\n\r\n**Additional information**\r\nIf possible, include a minimal, complete, and verifiable example to help us identify the issue. \r\n",
