            "body": "**Brief of your idea**\r\nNow the config of `genesis block`  too complex that less of user can config this.\r\nFor more convenient to  generate genesis block config. It's will be better that command tool support generate this config automatic. \r\n\r\n**What could be better if XuperChain using your idea**\r\nIt will be easier to generate genesis block config.\r\n\r\n**Are there any side effects?**\r\nNothing worse.\r\n\r\n**Additional information**\r\nmaybe used as interactive command like this:\r\n```\r\n./xchain-cli genesis-cfg gen\r\n>>\r\n>>\r\n```",
