            "state": "open",
            "body": "**Brief of the issue**\r\nI am studying the XuperChain and learning it form the website:https://xuperchain.readthedocs.io/zh/latest/advanced_usage/create_contracts.html#wasm\r\nWhen i am trying to run the XuperChain and deploy a contract locally,i meet a problem.\r\n\r\n**Your environment**\r\nmacos\r\n\r\n**Repo steps**\r\n1\u3001compile the example file: xuperchain/core/contractsdk/go/example/counter/counter.go \r\n2\u3001copy the compiled file to the directory\uff1a../xuperchain/output/data/blockchain/xuper/wasm\r\n3\u3001deploy the compiled file:\r\n./xchain-cli wasm deploy --account XC1111111111111111@xuper --cname counter -m -a '{\"creator\": \"someone\"}' data/blockchain/xuper/wasm/counter\r\n error happens:\r\nPreExe contract response : rpc error: code = Unknown desc = trap error:go.runtime.resetMemoryDataView can't be resolved, logid:1583217833820854000_1_8081\r\n\r\n**Expected behaviours**\r\n![image](https://user-images.githubusercontent.com/57782038/75752021-d3cfa380-5d62-11ea-9822-02ad733d281d.png)\r\n\r\n**What actually happened**\r\n![image](https://user-images.githubusercontent.com/57782038/75752100-f82b8000-5d62-11ea-8bb7-3f8ba40832e2.png)\r\n\r\n\r\n**Additional information**\r\nIf possible, include a minimal, complete, and verifiable example to help us identify the issue. This also helps check that the issue is not with your own code.\r\n",
