            "body": "**Brief of your idea**\r\nNow the private key was plaintext storage. It's better to support encrypted storage of private key.\r\nIt's similar to  wallet.dat of bitcoin.\r\n[wallet.dat](https://mistydew.github.io/blog/2018/09/bitcoin-rpc-command-walletpassphrase.html)\r\n**What could be better if XuperChain using your idea**\r\nLocal private key will be more secure\r\n\r\n**Are there any side effects?**\r\nNothing worse.\r\n\r\n**Additional information**\r\nOnly command line tools need to be supported in this proposal. ",
