            "body": "**Brief of the issue**\r\nFollowing to this [tutorial](https://github.com/xuperchain/xuperunion/wiki/%E8%B6%85%E7%BA%A7%E9%93%BE%E6%B5%8B%E8%AF%95%E7%BD%91%E7%BB%9C%E4%BD%BF%E7%94%A8%E6%8C%87%E5%8D%97) to deploy my first contract, everything is good until 4.3( contract deployment). I successfully created an account but failed to generate the transaction of contract deployment.\r\n\r\nThe output of `./xchain-cli wasm deploy --account XC8888888888666666@xuper --cname copy -H 14.215.179.74:37101 -m -A data/acl/addrs --arg '{\"creator\":\"xchain234\"}' --out\r\nput contractRawTx.out --fee 144200 counter\r\n` is as follows:\r\n```\r\ncontract response: contract has not been banned\r\ncontract response: access permission succeed\r\ncontract response: initialize succeed\r\nThe gas you cousume is: 144184\r\nThe fee you pay is: 144200\r\nSelect utxo error, details:NOT_ENOUGH_UTXO_ERROR\r\n\r\n```\r\n\r\n**Your environment**\r\nXuperUnion v3.2 branch and using the docker environment.\r\n\r\n**Repo steps**\r\nDescribe how to reproduce this issue.\r\n\r\n**Expected behaviours**\r\nHave an contractRawTx.out transaction as output\r\n\r\n**What actually happened**\r\nNo output is created\r\n\r\n**Additional information**\r\nIf possible, include a minimal, complete, and verifiable example to help us identify the issue. This also helps check that the issue is not with your own code.\r\n",
