            "body": "When cross chain query is initiated in the contract, an error is reported: syscall method not found\r\n\r\nThen I read the source code and found that the methodCrossContractCall value of contract_context.go is \"CrossContractCall\", while the corresponding cross chain method of syscall_service.go is \"CrossContractQuery\". Then I modified the methodCrossContractCall value to CrossContractQuery, so that I can successfully enter syscall_service.go\r\n\r\nbut another error msg :\"ResolveChain error, err:get contract desc for 'crossQueryNaming' error:Key not found ctx id:10\"\r\n",
