                    "author_association": "COLLABORATOR",
                    "body": "In fact, the multisignature algorithm used in the cmd is just a demo. It should not be a one round process. The problem you mentioned in this demo,  is because Ki is stored in the KList of MultiSigData struct. This struct should never be used in the real scenes. In fact, Ki should be only stored in the node which is participating the multisignature process, and be used for calculating R and Si, what's more, if the node has received a Si calcaulating request with C, R and m, and then receives another C, R with a different m for Si calcaulating request, this node should aquire that this is an attack which will be rejected. In order to do that, each node will maintain a local history about C, R and m. So we fully understand how to use multisignature correctly , and this demo does have some risks. Thanks a million for that.",
