                    "body": "The measures that @HawkJing mentioned is effective to defense the attack in multi-signature scheme, but it is not enough without some sepecific measures. I think it really need some more formal discussions for how to use  compact multi-signature correctly in blockchain system.\r\n\r\nI notice that the multisignature is added as a feature since v3.3.0,I want to know whether it's possible for (1) removing the feature from current version or marking it be a experiment feature in document and help option in cmd (2) opening a new branch for that feature.",
