            "state": "open",
            "body": "**Brief of your idea**\r\nThe document of XuperChain was maintained in [XuperChain Doc]( https://github.com/xuperchain/docs) repo. And the website is [Docs](https://xuperchain.readthedocs.io/zh/latest/)\r\nThe document now only support to V3.3. \r\nThere are many function haven't written in the document, such as `cross chain`, `HD secret`, `xdev tool`, `TEE privacy data protection`.  \r\n\r\n**What could be better if XuperChain using your idea**\r\nIt's better to support the technical and use documents of the latest version v3.7.\r\n\r\n\r\n**Are there any side effects?**\r\nNothing worse.\r\n\r\n**Additional information**\r\nNothing",
