            "state": "open",
            "body": "**Brief of the issue**\r\nWhen i tried to deploy the wasm chaincode following [the official tutorial](https://xuperchain.readthedocs.io/zh/latest/advanced_usage/create_contracts.html#native) and input command like `./xchain-cli wasm deploy --account XC1111111111111111@xuper --cname counter -m -a '{\"creator\": \"so\r\nmeone\"}' data/blockchain/xuper/wasm/counter.wasm`, then xchain responsed the following message: \r\n```shell\r\nPreExe contract response : rpc error: code = Unknown desc = run wasm2c error:fork/exec /home/work/xuperunion/wasm2c: exec format error , logid:1589854906124195400_1_8081\r\n```\r\n\r\n**Your environment**\r\nXuperChain: 3.7\r\nOS\uff1aMacOSX Darwin Kernel Version 19.4.0\r\nGo\uff1ago1.13.11\r\ngcc\uff1aApple clang version 11.0.3\r\n\r\n**Additional information**\r\nMy gcc point to clang actually, i tried to build and run xchain from docker (the official one base on ubuntu:16.04) either and gived me the same response above. I build the wasm chaincode both with golang and cpp, and tried another chaincode (named math), xchain always gived me the same response above. Please help me.",
