            "state": "closed",
            "body": "**Brief of the issue**\r\nIn function `func (uv *UtxoVM) verifyBlockTxs`, when invoke `verifyDAGTxs` method in goroutine, it passes `txs[start:end]` as the argument, but `txs` are the raw unsorted transactions, why use it as the DAGTxs?\r\n\r\n**Your environment**\r\nmaster brach, macos\r\n\r\n**Repo steps**\r\nIf the txGraph is\r\n```\r\ngraph[\"tx3\"] = []string{\"tx1\", \"tx2\"}\r\ngraph[\"tx4\"] = []string{\"tx5\", \"tx6\"}\r\ngraph[\"tx7\"] = []string{}\r\n```\r\n\r\n**Expected behaviours**\r\nUsing `TopSortDFS`, the result is \r\n```\r\norder-> [tx7 tx4 tx6 tx5 tx3 tx2 tx1]\r\ntopsort_test.go:144: circle-> false\r\ntopsort_test.go:145: childDAG-> [1 3 3]\r\n```\r\nand the subgrpahs are\r\n```\r\n[tx1 tx2 tx3]\r\n[tx5 tx6 tx4]\r\n[tx7]\r\n```\r\n\r\n**What actually happened**\r\nUsing `txs[start:end]`, the DAGTxs are\r\n```\r\n[tx1]\r\n[tx2 tx3 tx4]\r\n[tx5 tx6 tx7]\r\n```\r\nis it right?\r\n\r\n**Additional information**\r\nnull\r\n",
