            "body": "**Brief of the issue**\r\nThe contract account failed to be created when I didn't pay the fee. But it's ok to transfer token to the account and query the balance. Does this make sense?\r\n\r\n**Your environment**\r\nXuperChain and MacOS\r\n\r\n**Repo steps**\r\n\r\n./xchain-cli account new --account 1111111111111114\r\ncontract response:\r\n        {\r\n            \"pm\": {\r\n                \"rule\": 1,\r\n                \"acceptValue\": 1.0\r\n            },\r\n            \"aksWeight\": {\r\n                \"dpzuVdosQrF2kmzumhVeFQZa1aYcdgFpN\": 1.0\r\n            }\r\n        }\r\n\r\nThe gas you cousume is: 1000\r\nYou need add fee\r\n\r\n./xchain-cli acl query --account XC1111111111111114@xuper\r\nnull\r\nunconfirmed\r\n\r\n./xchain-cli transfer --to XC1111111111111114@xuper  --amount 100000000000\r\n\r\n./xchain-cli account balance XC1111111111111114@xuper\r\n100000000000\r\n",
