            "body": "**Brief of the issue**\r\nIn the Linux env , when I execute this command \"./xchain-cli status -H 127.0.0.1:37101\".\r\n it says\"rpc error: code = Unavailable desc = all SubConns are in TransientFailure, latest connection error: connection error: desc = \"transport: Error while dialing dial tcp 127.0.0.1:37102: connect: connection refused\"\"\r\n\r\n**Your environment**\r\nLinux(CentOS7)\r\ngo 1.13.4\r\n\r\n**Repo steps**\r\n1.  rm -rf keys/ && netkeys/\r\n2. ./xchain-cli account newkeys -f && ./xchain-cli netURL gen\r\n3. change xuper.json\r\n4. ./xchain-cli createChain\r\n5.nohup ./xchain\r\n6. ./xchain-cli status -H 127.0.0.1:37101\r\n\r\n**Expected behaviours**\r\nI have tried to stop firewald , but it doesn't work.\r\n\r\n**What actually happened**\r\nDescribe what actually happened. Include the full traceback if there was an exception.\r\n\r\n**Additional information**\r\nIf possible, include a minimal, complete, and verifiable example to help us identify the issue. This also helps check that the issue is not with your own code.\r\n",
