            "body": "### Issue description\r\nI tried to use xuper-sdk-go to invoke a contract with a null string in args map, which looks like (for instance)\r\nargs := map[string]string{\r\n    \"key\": \"key\"\r\n    \"desc\": \"test\",\r\n    \"value\": \"\",    //  value is null\r\n}\r\nand SDK got error \"Failed to post tx: TX_VERIFICATION_ERROR\". \r\nIn xchain node logs, I found ImmediateVerifyTx: txid not match\", \"Txid verify failed\"...\r\nIt works when \"value\" is not null.\r\n\r\n### environment\r\nXuperChain3.7\r\nUbuntu18/go1.13.5/gcc7.5.0\r\n",
