            "body": "## Background\r\nThe `github.com/xuperchain/xuperchain` uses [Go modules](https://github.com/golang/go/wiki/Modules) and the current release version is `v3`. And it\u2019s module path is `\"github.com/xuperchain/xuperchain\"`, instead of `\"github.com/xuperchain/xuperchain/v3\"`. It must comply with the specification of \"Releasing Modules for v2 or higher\" available in the Modules documentation. Quoting the specification:\r\n> A package that has opted in to modules _must_ include the major version in the import path to import any v2+ modules\r\n> To preserve import compatibility, the go command requires that modules with major version v2 or later use a module path with that major version as the final element. For example, version v2.0.0 of _example.com/m_ must instead use module path _example.com/m/v2_.\r\nhttps://github.com/golang/go/wiki/Modules#releasing-modules-v2-or-higher\r\n\r\n## Steps to Reproduce\r\nGO111MODULE=on, run `go get` targeting any version >= v3.1.0 of the `xuperchain/xuperchain`:\r\n```\r\n$ go get github.com/xuperchain/xuperchain@v3.7.0\r\ngo: finding github.com/xuperchain/xuperchain v3.7.0\r\ngo: finding github.com/xuperchain/xuperchain v3.7.0\r\ngo get github.com/xuperchain/xuperchain@v3.7.0: github.com/xuperchain/xuperchain@v3.7.0: invalid version: module contains a go.mod file, so major version must be compatible: should be v0 or v1, not v3\r\n```\r\nSO anyone using Go modules will not be able to easily use any newer version of `xuperchain/xuperchain`.\r\n\r\n## Solution\r\n### 1. Kill the go.mod files, rolling back to GOPATH.\r\nThis would push them back to not being managed by Go modules (instead of incorrectly using Go modules).\r\nEnsure compatibility for downstream module-aware projects and module-unaware projects projects\r\n\r\nI see these dependencies in your go.mod file, which need modle awareness. So you'd better not use third-party tools(such as: Dep, glide, govendor\u2026).\r\n```\r\ngithub.com/dgraph-io/badger/v2 v2.0.0-rc.2 \r\n```\r\nYou also need to update the import path to:\r\n```\r\nimport github.com/dgraph-io/badger/\u2026\r\n```\r\n\r\n\r\n### 2. Fix module path to strictly follow SIV rules.\r\nPatch the `go.mod` file to declare the module path as `github.com/xuperchain/xuperchain/v3` as [per the specs](https://github.com/golang/go/wiki/Modules#semantic-import-versioning). And adjust all internal imports.\r\nThe downstream projects might be negatively affected in their building if they are module-unaware (Go versions older than 1.9.7 and 1.10.3; Or use third-party dependency management tools, such as: Dep, glide,govendor\u2026).\r\n\r\nIf you don't want to break the above repos. This method can provides better backwards-compatibility.\r\nRelease a v2 or higher module through the major subdirectory strategy: Create a new v3 `subdirectory` (github.com/xuperchain/xuperchain/v3) and place a new go.mod file in that subdirectory. The `module path` must end with `/v3`. Copy or move the code into the v3 subdirectory. Update `import statements` within the module to also use `/v3` (import \"github.com/xuperchain/xuperchain/v3/\u2026\"). Tag the release with `v3.x.y`.\r\n\r\n\r\n### 3.  Suggest your downstream module users use hash instead of a version tag.\r\nIf the standard rule of go modules conflicts with your development mode. Or not intended to be used as a library and does not make any guarantees about the API. So you can\u2019t comply with the specification of \"Releasing Modules for v2 or higher\" available in the Modules documentation. \r\nRegardless, since it's against one of the design choices of Go, it'll be a bit of a hack. Instead of `go get github.com/xuperchain/xuperchain@version-tag`, module users need to use this following way to get the `xuperchain/xuperchain`:\r\n   (1) Search for the `tag` you want (in browser)\r\n   (2) Get the `commit hash` for the `tag` you want\r\n   (3) Run `go get github.com/xuperchain/xuperchain@commit-hash`\r\n   (4) Edit the go.mod file to put a comment about which version you actually used\r\nThis will make it difficult for module users to get and upgrade `xuperchain/xuperchain`.\r\n\r\n**[*]** You can see who will be affected here: [6 module users, e.g., blocktree/xuperchain-adapter, blocktree/xuper-contract-dev, jason-cn-dev/xuper-sdk-go]\r\nhttps://github.com/search?q=github.com%2FLyricTian%2Fgin-admin+extension%3Amod&type=Code&ref=advsearch&l=&l=\r\n\r\n## Summary\r\nYou can make a choice to fix DM issues by balancing your own development schedules/mode against the affects on the downstream projects.\r\n\r\nFor this issue, `Solution 2` can maximize your benefits and with minimal impacts to your downstream projects the ecosystem. \r\n\r\n## References\r\n* https://github.com/golang/go/wiki/Modules#semantic-import-versioning\r\n* https://golang.org/cmd/go/#hdr-Module_compatibility_and_semantic_versioning\r\n* https://github.com/golang/go/wiki/Modules#releasing-modules-v2-or-higher\r\n",
