            "body": "**Brief of your idea**\r\nUsing docker-compose to deploy a multi-node p2p network quickly\r\n\r\n**What could be better if XuperChain using your idea**\r\nIt will be much easier to deploy a multi-node p2p network.\r\nI find it dirty work to deploy a multi-node network following [instructions](https://xuperchain.readthedocs.io/zh/latest/advanced_usage/multi-nodes.html) . One must read documentations carefully and deal with things like port conflict, boot node URL generation and and  genesis block creation.\r\n\r\nYou just need to type `docker-compose up` to deploy a completely distributed p2p network.\r\n\r\nWhat's more, it can be extended for integration testing. \r\n\r\n**Are there any side effects?**\r\nNo\r\n\r\n**Additional information**\r\nIf possible, include a minimal, complete, and verifiable example to help us identify the issue. \r\n",
