            "body": "**Brief of the issue**\r\nDescribe here\r\n\u6211\u4f7f\u7528\u5b98\u65b9\u7684counter golang\u4f8b\u5b50\u4ee3\u7801,\u6dfb\u52a0\u4e86go.mod\u6587\u4ef6,\u4f7f\u7528 ```GOOS=js GOARCH=wasm go build -o counter.wasm ``` \u7f16\u8bd1\u6210wasm\u6587\u4ef6,\u5728\u4f7f\u7528 ```./xchain-cli wasm deploy --account XC1111111111111111@xuper --cname counter  --fee 5200000 --runtime go ./counter.wasm```\u53d1\u5e03\u65f6,\u4e00\u76f4\u662f\u5361\u6b7b\u72b6\u6001,\u6ca1\u6709\u8fd4\u56de\u503c.\u4f7f\u7528xdev\u5de5\u5177\u7684\u4f8b\u5b50\u662f\u6210\u529f\u7684.\r\n**Your environment**\r\nXuperChain and OS/Go/gcc version etc.\r\nCentOS Linux release 7.9.2009 (Core)\r\ngo version go1.13.15 linux/amd64\r\n\r\n./xchain --version\r\nmaster-2d08ff1 2021-02-26-16:06:51\r\n\r\ngcc -v\r\n\u4f7f\u7528\u5185\u5efa specs\u3002\r\nCOLLECT_GCC=gcc\r\nCOLLECT_LTO_WRAPPER=/usr/libexec/gcc/x86_64-redhat-linux/4.8.5/lto-wrapper\r\n\u76ee\u6807\uff1ax86_64-redhat-linux\r\n\u914d\u7f6e\u4e3a\uff1a../configure --prefix=/usr --mandir=/usr/share/man --infodir=/usr/share/info --with-bugurl=http://bugzilla.redhat.com/bugzilla --enable-bootstrap --enable-shared --enable-threads=posix --enable-checking=release --with-system-zlib --enable-__cxa_atexit --disable-libunwind-exceptions --enable-gnu-unique-object --enable-linker-build-id --with-linker-hash-style=gnu --enable-languages=c,c++,objc,obj-c++,java,fortran,ada,go,lto --enable-plugin --enable-initfini-array --disable-libgcj --with-isl=/builddir/build/BUILD/gcc-4.8.5-20150702/obj-x86_64-redhat-linux/isl-install --with-cloog=/builddir/build/BUILD/gcc-4.8.5-20150702/obj-x86_64-redhat-linux/cloog-install --enable-gnu-indirect-function --with-tune=generic --with-arch_32=x86-64 --build=x86_64-redhat-linux\r\n\u7ebf\u7a0b\u6a21\u578b\uff1aposix\r\ngcc \u7248\u672c 4.8.5 20150623 (Red Hat 4.8.5-44) (GCC) \r\n\r\n**Repo steps**\r\n\u4f7f\u7528  ```GOOS=js GOARCH=wasm go build -o counter.wasm ``` \u7f16\u8bd1counter.wasm\r\n\u4f7f\u7528 ```./xchain-cli wasm deploy --account XC1111111111111111@xuper --cname counter  --fee 5200000 --runtime go ./counter.wasm```\u53d1\u5e03\u5408\u7ea6\r\n\r\n**Expected behaviours**\r\n\u521b\u5efa\u5408\u7ea6\u6210\u529f\r\n\r\n**What actually happened**\r\n\u547d\u4ee4\u5361\u6b7b,\u65e0\u8fd4\u56de\u503c\r\n\r\n**Additional information**\r\n\r\n",
