            "body": "**Brief of the issue**\r\nThe configuration uses the xpoa consensus algorithm and gm encryption, and the 3 nodes cannot operate normally after starting, such as\r\n```./xchain-cli account new --account 1111111111111111 --fee 1000 -H 127.0.0.1:37101```  is always in unconfirmed state, and finally failed.\r\nIn the same environment, if I comment out ```\"crypto\": \"gm\",``` in ```./data/config/xuper.json```, it can be used normally\r\n\r\n**Your environment**\r\nCentOS Linux release 7.9.2009 (Core)\r\ngo version go1.12.5 linux/amd64\r\n\r\nxchain v3.10-9399bae 2021-02-24-09:38:51\r\n\r\n**Repo steps**\r\n\r\n\r\n**Expected behaviours**\r\nThe xpoa consensus algorithm can use gm encryption\r\n\r\n**What actually happened**\r\nNode cannot be used normally\r\n\r\n**Additional information**\r\n\r\n",
