            "body": "**Brief of the issue**\r\n```./xchain-cli native invoke --method get -a '{\"key\":\"stones\"}' javacounter --fee 100 -H 127.0.0.1:37103```\r\nRandom return\r\n```PreExe contract response : rpc error: code = Unknown desc = get contract desc for 'javacounter' error:Key not found, logid:1614843174460667909_1_8081```\r\nThere is no 1614843174460667909_1_8081 in the log\r\n\r\nor\r\n\r\n```shell\r\ncontract response: 2\r\nThe gas you cousume is: 1\r\nThe fee you pay is: 100\r\nTx id: 687e8e6ec357b99f8847019ac0f03f4d9eab9ee3608c13a0035ee5794d3c03af\r\n```\r\n\r\n\r\n**Your environment**\r\nXuperChain and OS/Go/gcc version etc.\r\n\r\nCluster of 3 servers,cryptotype: \"gm\", xpoa\r\nxchain-cli version v3.10-9399bae 2021-02-24-09:38:15\r\nCentOS Linux release 7.9.2009 (Core)\r\ngo version go1.12.5 linux/amd64\r\ngcc  4.8.5 20150623 (Red Hat 4.8.5-44) (GCC) \r\n\r\n**Repo steps**\r\nCall the java natvie contract in the example\r\n\r\n**Expected behaviours**\r\nReturn correct result\r\n```shell\r\ncontract response: 2\r\nThe gas you cousume is: 1\r\nThe fee you pay is: 100\r\nTx id: 687e8e6ec357b99f8847019ac0f03f4d9eab9ee3608c13a0035ee5794d3c03af\r\n```\r\n\r\n**What actually happened**\r\nRandom return errors\r\n```PreExe contract response : rpc error: code = Unknown desc = get contract desc for 'javacounter' error:Key not found, logid:1614843174460667909_1_8081```\r\n\r\n\r\n**Additional information**\r\n\r\n",
